import styles from "./App.module.css";
import { useEffect, useState } from "react";

function Title() {
  return 
  <h1>
    hello
  </h1>
}

function App() {
  const [showing, setShowing] = useState(false);
  const onClick = () => setShowing((prev) => !prev);
  return (
    <div>
      <Title/>
      <button onClick={onClick}>버튼</button>
    </div>
  );
}

export default App;
